import React from 'react';
import { connect } from 'react-redux'

class Models extends React.Component {
    render() {
        return (
            <div>
                {this.props.models.years.map(year => year.makes.map(make => make.models.map(model => (
                    <option className="option" onClick={this.props.handleModelChange} value={model.name} key={model.id}> {model.name} </option>
                ))))}
            </div>
        )
    }
}

export default connect(state => state)(Models);
